import React from 'react';
import logo from './logo.svg';
import './Card.css';

function Card() {
    return (

        <div className="card">
            <div className="background-image" style={{ backgroundImage: 'url(https://picsum.photos/300/200)' }}></div>

            <div className="logos">
                <img src="https://picsum.photos/50/50" alt="Logo 1" />
                <img src="https://picsum.photos/50/50" alt="Logo 2" />
                <img src="https://picsum.photos/50/50" alt="Logo 3" />
            </div>

            <div className="text">
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut malesuada orci id tellus rhoncus, eu congue arcu volutpat. Nam placerat ultricies ipsum, in facilisis odio efficitur eu.
            </div>

            <div className="divider"></div>

            <div className="title">Título</div>
        </div>



    );
}

export default Card;
